(361, 54, 2, 1, 19, NULL, NULL, NULL, NULL, NULL, NULL, '25.6564843,-100.36944010000002', '2016-08-26 18:00:23', 1, 3, 0, 6170000.00, 195.00, NULL, 1, NULL, 0, 1, 'Del Valle', 'Exclusiva torre de departamentos tipo boutique diseñada por arquitecto prestigiado.\r\nCuenta con recibidor, sala, cocina, lavandería con baño, baño de visitas, 3 recamaras con su baño, closets.\r\nTerraza, lobby bodega.\r\nUbicación privilegiada en la colonia del valle.', NULL, '8183562248', 0, 1, 3, 1, 1, 'Torre Amazonas Departamento', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, 2, 0, NULL, '2016-04-22 00:00:00', 0, 1, 37, '2016-11-12 15:47:25', 0, NULL, NULL, 1, 69771, NULL, 0.00, 0, 9),
(362, 37, 2, 1, 19, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-08-26 18:05:22', 0, 3, 0, 5500000.00, 200.00, NULL, 1, NULL, 0, 0, 'Residencial Santa Bárbara', '"Departamento 3 recamaras cada una con su baño propio, y un medio baño de visitas, cancelería, lavandería, cuarto de servicio, sala, comedor, 2 cajones de estacionamiento, portón eléctrico.(no incluye cocina).\r\nBalcón con vistas a avenidas principales de la ciudad.   "', NULL, '8183562248', 0, 1, 1, 1, 1, 'Departamento Residencial Santa Barbara', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, 2, 0, NULL, '2016-04-15 00:00:00', 0, 0, NULL, NULL, 0, NULL, NULL, 1, 69077, NULL, 0.00, 0, 9),
(363, 54, 1, 1, 19, NULL, NULL, NULL, NULL, NULL, NULL, '25.6573447,-100.40175010000002', '2016-08-26 18:09:54', 1, 4, 4, 38000000.00, 999.99, 780.00, 1, NULL, 0, 0, 'La Cima', 'Hermosa Residencia con acabados de lujo, pisos de mármol, cocina de granito, cochera para 5 autos, terrazas, subestación, elevador, vistas espectaculares y excelente ubicación con avenidas principales de San Pedro.', NULL, '8183562248', 0, 1, 3, 1, 1, 'Residencial Col.La Cima', NULL, NULL, NULL, NULL, 23.00, 34.00, NULL, NULL, NULL, 7, 5, 0, NULL, '2016-04-07 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 3, 68197, NULL, 0.00, 0, 9),
(364, 54, 9, 1, 19, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-08-26 18:12:03', 1, 0, 1, 23700000.00, NULL, 1255.10, 1, NULL, 0, 1, 'Obispado', '1255.1 Mt Terreno\r\n28.42 Mt Frente\r\n44.16  Mt Fondo\r\nCUENTA CON PERMISO DE USO DE SUELO MIXTO  D 8\r\n\r\nCasa en esquina\r\n\r\nLa casa tiene preparación en su cimentación para un segundo piso, màs sin embargo se pueden construir hasta 5 pisos sobre el nivel de la calle reforzando la cimentación\r\nPuede tener capacidad hasta 20 o màs carros pues tiene un jardín muy amplio en la parte de atrás con entrada por la otra calle\r\n\r\nCuenta con todos los servicios', NULL, '8183562248', 0, 2, 1, 3, 2, 'Obispado', NULL, NULL, NULL, 3.00, 28.42, 44.16, NULL, NULL, '40 años', 0, 6, NULL, NULL, '2014-12-14 00:00:00', 1, 0, 58, '2017-03-16 18:43:24', 0, NULL, NULL, 0, 31861, 50, 0.00, 0, 5),
(365, 54, 1, 1, 19, NULL, NULL, NULL, NULL, NULL, NULL, '25.6867816,-100.42196280000002', '2016-08-26 18:12:52', 1, 3, 2, 13400000.00, 456.00, 402.00, 1, NULL, 0, 0, 'Las Fincas', '"Las características de estas residencias en Valle Poniente, son su amplitud, con cielos altos, de grandes ventanas, la distribución es muy funcional y atractiva para el propietario, el tamaño de las recámaras es muy adecuado, siendo éstas de las más grandes en referencia al mercado en general, el diseño arquitectónico es altamente atractivo a primera vista y con alta calidad en las especificaciones.\r\n\r\nEntregadas llave en mano y las especificaciones incluyen lo siguiente:\r\n\r\n1. Impermeabilizacion por sistema de membranas asfálticas.\r\n2. Puertas de madera alemanas Haicor.\r\n3. Ventanería de Aluminio Cuprum Eurovent S45.\r\n4. Cancelería de Cristal templado en baños.\r\n5. Duela sólida de 14mm de Bamboo en toda la casa, excepto en áreas húmedas.\r\n6. Porcelánicos en áreas húmedas y de servicio.\r\n7. Pintura Berel Multitono a escoger.\r\n8. Mobiliario Sanitario y Mezcladoras.\r\n9. Luminarios Magg.\r\n10. Accesorios y material eléctrico Estévez.\r\n11. Accesorios Sanitarios.\r\n12. Vestidores y Closets diseñados por diedro.diseño contemporáneo.\r\n13. Cocina Integral.\r\n\r\n1. Minisplit de 2 ton en las 3 recámaras y de 3 ton en la sala/comedor y en la estancia de TV marca Trane o LG o Toshiba.\r\n2. Equipos electrodomésticos para la cocina y lavandería marca GE monogram y GE profile.\r\n3. Amoblamiento de toda la casa en 3 ambientes diferentes con muebles importados alemanes e italianos a precio de                        Mueblería local.\r\n4. Decoración, Interiorismo y luminarias de acento y detalle importadas alemanas e italianas a precio local.\r\n5. Equipo de Aspirado integral en todas las habitaciones. \r\n6. Diseño de Paisajismo y Construcción con especies nativas de la región, con riego automatizado por aspersión por petición.\r\n7. Vapor en cabinas de regadera.\r\n8. Tina de hidromasaje y bidet en baño principal.        \r\n9. Automatización y Domótica con tecnología francesa.\r\n10. Sistema de Alarma y Vigilancia.\r\n11. Diseño y Construcción de Alberca o Estanque Natural/Espejo de Agua con mantenimiento sustentable ecológico-natural. \r\n12. Jacuzzi para exteriores para 5 ó 7 personas en deck.\r\n\r\nCREDITO HIPOTECARIO PREVENTA SCOTIABANK', NULL, NULL, 0, 1, 3, 1, 3, 'Las Fincas', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Nuevo', 6, 3, NULL, NULL, '2015-12-11 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 1, 61521, NULL, 0.00, 0, 6),
(366, 54, 1, 1, 19, NULL, NULL, NULL, NULL, NULL, NULL, '25.6854342,-100.37496770000001', '2016-08-26 18:14:07', 1, 3, 2, 8400000.00, 540.00, 311.22, 1, NULL, 0, 0, 'Colinas de San Jerónimo', '"Casa con excelente ubicación en calle cerrada, frente a parque e Iglesia.\r\n3 recamaras con su baño vestidor, cochera techada, sótano, jardín, asador ."', NULL, '8183562248', 0, 2, 3, 1, 1, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '10 años', 5, 2, NULL, NULL, '2016-03-30 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 2, 67621, NULL, 0.00, 0, 5),
