(221, 54, 2, 1, 19, NULL, NULL, '2009', NULL, NULL, NULL, NULL, '2016-08-25 19:18:53', 1, 1, 1, 1583000.00, 47.00, NULL, 1, NULL, 0, 0, 'Distrito Tec', 'Increíbles precios de Preventa\r\n\r\nCondotec es un innovador concepto ideal para inversionistas, el edificio contara con 140 Suites Condominales de 1 o 2 recamras, que van desde los 47 m2 hasta 110 m2.esta ubicado sobre la Av. Eugenio Garza Sada, casi esquina con la Av. Luis Elizondo, frente al TEC de Monterrey, considerada como una de la zonas estudiantiles mas importantes de México.\r\n\r\nSe encuentra dentro del plan maestro llamado “DISTRITO TEC”, el cual esta siendo desarrollado por el TEC de Monterrey, para que sea una comunidad dinámica, segura e inspiradora que atrae y retiene talento, e impulsa el desarrollo y posicionamiento de Monterrey como ciudad de innovación, emprendimiento y sustentabilidad.\r\n\r\n• Este plan maestro, contempla la regeneración de todos los alrededores del TEC, generando una zona estudiantil, de estudio, aprendizaje, innovación y convivencia, similar a la que se encuentra en Austin, TX, en la zona de UT (Universidad of Texas)\r\n\r\nContará con los siguientes amenities ubicados en el 12vo piso:\r\n1. Alberca.\r\n2. Jacuzzi.\r\n3. Centro de Estudio.\r\n4. Salón de eventos tipo Lounge Bar\r\n5. Cuarto de juegos.\r\n6. Cine.\r\n7. Gimnasio.Pool de rentas.\r\n\r\n•Los inversionistas que inviertan en RESIDENCIAS CONDOTEC, tendrán la opción de aportar sus unidades al Pool de Rentas del Condohotel.\r\n\r\n•Para los que decidan participar en el Pool de Rentas del Condohotel, será obligatorio adquirir el paquete de equipamiento, de tal manera que todas las unidades tengan el mismo equipamiento y mobiliario.\r\n\r\n•El Pool de Rentas reparte mensualmente los Ingresos Netos que genera el Condohotel en base al indiviso de cada inversionista, de tal manera que el inversionista recibirá ingresos de las rentas independientemente si su unidad esta rentada o no.\r\n\r\nDepartamentos de 47,56,58,92 y 110m2\r\n\r\nLos precios van desde $1.6 hasta $3.2 mdp\r\n\r\nSe entregan en obra blanca \r\n\r\nEstará listo para el verano del 2017\r\n\r\nLos precios están sujetos a cambios.', NULL, NULL, 0, 1, 3, 1, 1, 'Condotec', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, '2016-04-16 00:00:00', 0, 0, NULL, NULL, 0, NULL, NULL, NULL, 69173, NULL, 0.00, 0, 5),
