(288, 54, 2, 1, 19, NULL, NULL, '1810', NULL, NULL, NULL, NULL, '2016-08-26 13:12:43', 1, 1, 1, 1625000.00, 56.00, NULL, 1, NULL, 0, 0, '-', 'Condotec es un innovador concepto ideal para inversionistas, el edificio contara con 140 Suites Condominales de 1 o 2 recamras, que van desde los 47 m2 hasta 110 m2.esta ubicado sobre la Av. Eugenio Garza Sada, casi esquina con la Av. Luis Elizondo, enfrente del TEC de Monterrey, considerada como una de la zonas estudiantiles mas importantes de México.\r\n\r\nse encuentra dentro del plan maestro llamado “DISTRITO TEC”, el cual esta siendo desarrollado por el TEC de Monterrey, para que sea una comunidad dinámica, segura e inspiradora que atrae y retiene talento, e impulsa el desarrollo y posicionamiento de Monterrey como ciudad de innovación, emprendimiento y sustentabilidad.\r\n\r\n• Este plan maestro, contempla la regeneración de todos los alrededores del TEC, generando una zona estudiantil, de estudio, aprendizaje, innovación y convivencia, similar a la que se encuentra en Austin, TX, en la zona de UT (Universidad of Texas)\r\n\r\nContará con los siguientes amenities ubicados en el 12vo piso:\r\n\r\n1. Alberca.\r\n2. Jacuzzi.\r\n3. Centro de Estudio.\r\n4. Salón de eventos tipo Lounge Bar\r\n5. Cuarto de juegos.\r\n6. Cine.\r\n7. Gimnasio.POOL DE RENTAS\r\n\r\n•Los inversionistas que inviertan en RESIDENCIAS CONDOTEC, tendrán la opción de aportar sus unidades al Pool de Rentas del Condohotel.\r\n\r\n•Para los que decidan participar en el Pool de Rentas del Condohotel, será obligatorio adquirir el paquete de equipamiento, de tal manera que todas las unidades tengan el mismo equipamiento y mobiliario.\r\n\r\n•El Pool de Rentas reparte mensualmente los Ingresos Netos que genera el Condohotel en base al indiviso de cada inversionista, de tal manera que el inversionista recibirá ingresos de las rentas independientemente si su unidad esta rentada o no.\r\n\r\nSe entregan en obra blanca \r\n\r\nEstará listo para el verano del 2017\r\n\r\nLos precios están sujetos a cambios.', NULL, '8183562248', 0, 1, 3, 1, 1, 'Condotec', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Nuevo', 1, 1, NULL, NULL, '2014-04-04 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 0, 69175, NULL, 0.00, 0, 5),
(289, 54, 2, 1, 19, NULL, NULL, NULL, NULL, NULL, NULL, '25.6854342,-100.37496770000001', '2016-08-26 13:13:59', 1, 3, 0, 5350000.00, 187.00, NULL, 1, NULL, 0, 0, 'Colinas de San Jerónimo', '"Hermoso departamento ubicado en uno de los puntos estratégicos de Monterrey y que se une a San Pedro en menos de 5 minutos. En excelentes condiciones, terminados de lujo, equipado. Excelente ubicación. •3 Recamaras con baño y closet cada una\r\n•Opción de oficina o estudio en una recamara\r\n•Cuarto de servicio con baño y closet\r\n•Baño de visitas\r\n•Jacuzzi en recamara principal\r\n•Sistema de sauna vapor en recamara principal\r\n•Sonido ambiental\r\n•Cocina equipada con electrodomésticos y encimera de cuarzo\r\n•Sistema de aire acondicionado nuevo de Mini-Split frio calor \r\n•Balcón 22mts2\r\n•Porcelanato Italiano\r\n•Iluminación con dimmer\r\n•Bodega 12 mts2\r\n•2 Cajones de estacionamiento techado\r\n•2 Salones de eventos\r\n•2 Albercas\r\n•Palapas con Asadores\r\n•Terraza de uso común con asador y baños\r\n•Área de niños con juegos infantiles \r\n•Extensas aéreas verdes\r\n•Guardería infantil\r\n•Sala de Cine\r\n•Portones eléctricos con control de acceso \r\n•Sistema de intercomunicación \r\n(Negociable)."', NULL, '8183562248', 0, 1, 1, 1, 3, 'Departamento de lujo en Venta en Retama', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 4, 2, 0, NULL, '2016-05-09 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 1, 71021, NULL, 0.00, 0, 5),
