(299, 54, 2, 1, 19, NULL, NULL, '1416', NULL, NULL, NULL, '25.6866142,-100.3161126', '2016-08-26 13:35:04', 1, 2, 1, 2887500.00, 110.00, NULL, 1, NULL, 0, 0, '-', 'Condotec es un innovador concepto ideal para inversionistas, el edificio contara con 140 Suites Condominales de 1 o 2 recamras, que van desde los 47 m2 hasta 110 m2.esta ubicado sobre la Av. Eugenio Garza Sada, casi esquina con la Av. Luis Elizondo, enfrente del TEC de Monterrey, considerada como una de la zonas estudiantiles mas importantes de México.\r\n\r\nse encuentra dentro del plan maestro llamado “DISTRITO TEC”, el cual esta siendo desarrollado por el TEC de Monterrey, para que sea una comunidad dinámica, segura e inspiradora que atrae y retiene talento, e impulsa el desarrollo y posicionamiento de Monterrey como ciudad de innovación, emprendimiento y sustentabilidad.\r\n\r\n• Este plan maestro, contempla la regeneración de todos los alrededores del TEC, generando una zona estudiantil, de estudio, aprendizaje, innovación y convivencia, similar a la que se encuentra en Austin, TX, en la zona de UT (Universidad of Texas)\r\n\r\nContará con los siguientes amenities ubicados en el 12vo piso:\r\n\r\n1. Alberca.\r\n2. Jacuzzi.\r\n3. Centro de Estudio.\r\n4. Salón de eventos tipo Lounge Bar\r\n5. Cuarto de juegos.\r\n6. Cine.\r\n7. Gimnasio.POOL DE RENTAS\r\n\r\n•Los inversionistas que inviertan en RESIDENCIAS CONDOTEC, tendrán la opción de aportar sus unidades al Pool de Rentas del Condohotel.\r\n\r\n•Para los que decidan participar en el Pool de Rentas del Condohotel, será obligatorio adquirir el paquete de equipamiento, de tal manera que todas las unidades tengan el mismo equipamiento y mobiliario.\r\n\r\n•El Pool de Rentas reparte mensualmente los Ingresos Netos que genera el Condohotel en base al indiviso de cada inversionista, de tal manera que el inversionista recibirá ingresos de las rentas independientemente si su unidad esta rentada o no.\r\n\r\nSe entregan en obra blanca \r\n\r\nEstará listo para el verano del 2017\r\n\r\nLos precios están sujetos a cambios.', NULL, NULL, 0, 1, 3, 1, 1, 'Condotec', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, 2, NULL, NULL, '2016-04-16 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 0, 69181, NULL, 0.00, 0, 5),
(300, 44, 3, 1, 19, NULL, NULL, NULL, NULL, NULL, NULL, '25.4701188,-100.18993699999999', '2016-08-26 13:36:36', 1, 3, 1, 11000000.00, 900.00, 999.99, 1, NULL, 0, 0, 'El Barrial', 'Es de una sola planta, con pequeños desniveles en el terreno, lo que permite lograr un conjunto interesante. Tiene volúmenes con techos inclinados muy altos con teja plana ( 500 m2 de teja ). La sala, el comedor y el salón de juegos son muy amplios y tienen techos con vigas y duela de madera. La entrada, sala, comedor y la cocina tienen piso de mármol beige, en placas grandes, con cenefa de mármol marrón emperador enmarcándolas. Las tres recámaras, las dos estancias, el salón de juegos, la oficina, el gimnasio y los clósets tienen preparación para duela. Las ventanas y puertas corredizas exteriores son de aluminio con vidrios dobles, así como cristal templado en las puertas de las regaderas. La alberca es muy grande (140 m2.), tiene una cascada y toda esta área tiene iluminación de colores, a un lado está la palapa-asador. Esta casa cuenta con acabados de cantera en varios volúmenes, molduras de ventanas y pretiles, así como en los pisos de: acceso principal, terraza techada frente a la alberca, en la palapa-asador, en la escalera de acceso de la alberca a las recámaras y en el balcón de la recámara principal. Toda la casa está hecha con block relleno de termo-lita, los techos tienen un empastado de este mismo material para mejorar el aislamiento térmico. Cochera techada para 6 autos y área exterior para dos autos. 2000 m2 de área para jardín dividido en tres zonas, en una de ellas se puede hacer una pequeña cancha de fútbol.', NULL, '8183562248', 0, 2, 1, 1, 1, 'Quina San Andrés el Barrial', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 4, 6, NULL, NULL, '2016-05-02 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 0, 70445, NULL, 0.00, 0, 7),
(301, 54, 1, 1, 19, NULL, NULL, NULL, NULL, NULL, NULL, '25.648649,-100.34104869999999', '2016-08-26 13:37:14', 1, 3, 0, 24926521.00, 615.25, 459.11, 1, NULL, 0, 0, 'Real de San Agustin', '"Exclusivas residencias nuevas de 459.6 m2 -603.96 m2 \r\n\r\nPrecio: $24,926,521.76 hasta los 28,654,055.50 M.N.\r\n\r\nCaracterísticas\r\n\r\n-Planta Baja\r\n\r\nCochera 6 Vehículos\r\nLavandería\r\nCuarto de Servicio\r\nTiques\r\n1/2 Baño\r\nPatio de Servicio\r\n \r\n-Planta 1er Nivel\r\nVestíbulo\r\nSala (doble altura)\r\nComedor\r\nCocina\r\nFamily room\r\nJardines (146 a 259 mts, dependiendo el terreno)\r\n \r\n-Planta 2do Nivel\r\nRecamaras (3)\r\nCloset\r\nBaño (3)\r\nFamily room\r\n\r\nDimensiones:\r\nTerreno: 459.11 mts  hasta los 603.90 mts\r\nConstrucción: 615.25 mts hasta los 692.46 mts\r\nJardines: 130 mts  hasta los 240 mts\r\n\r\nEquipamiento\r\n1.- Sistema inteligente y ahorro de energía  de Aire Acondicionado BRF, en toda la casa.\r\n2.- Closet totalmente equipados en Recama principal y en recamaras secundarias.\r\n3.- Cocina de marca Albero, equipada con lo siguiente:\r\n·      Parrilla\r\n·      Lavavajillas\r\n·      Campa de 36”\r\n·      Microondas\r\n·      Horno\r\n·      Trim 30”\r\n·      Cajón Caliente\r\n4.-Preparación para Elevador (en el precio de venta no incluye, solo a petición del cliente)\r\n5.-Ventanas de Duovent de 9mm, termo acústica.\r\n6.- Muros con aislantes térmicos\r\n7.- Pisos cerámicos italianos de 60x120\r\n"', NULL, '8183562248', 0, 1, 1, 1, 1, 'Casas en venta en Real de San Agustin', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, 6, 0, NULL, '2015-08-22 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 1, 48205, NULL, 0.00, 0, 9),
