(387, 54, 2, 1, 19, 'Sendero Las Privanzas', '305', NULL, NULL, NULL, NULL, '25.6573447,-100.40175010000002', '2016-08-29 11:45:30', 1, 3, 1, 9900000.00, NULL, 5350.00, 1, NULL, 0, 0, 'Privanzas 4to  Sector', 'Eva es un desarrollo pensado para ser en uno de los proyectos inmobiliarios más rentables de la zona ya que cuenta con una excelente ubicación en una de las áreas de mayor plusvalía de San Pedro.\r\n\r\nSuperficie: \r\n\r\nDesde $9,900.000 MN – PH 14,875,000 MN\r\n* El edificio cuenta con 24 departamentos desde  260m2 hasta 582mts.\r\n-          3 Recamaras (con vestidor y baño completo)\r\n-          Sala y Comedor\r\n-          Cocina Integral Alemana y Electrodomésticos Teka\r\n-          Cuarto TV\r\n-          Lavandería y Cuarto de Servicio\r\n-          1 Bodega\r\n•	3 cajones de estacionamiento por departamento y el PH4 tiene 4.\r\n\r\n•	El edificio esta dividido en el lado Pte. y el lado Ote. por lo que  resultan dos departamentos por piso de cada lado con 2 elevadores.\r\n\r\n•	Son 6 pisos ( 6 es de los PH)\r\n\r\n•	2,000 m2 de áreas verdes privadas\r\n\r\nAMENIDADES.\r\n\r\n•	Salón de eventos\r\n•	Salón de juegos\r\n•	Sala de usos múltiples\r\n•	Gimnasio\r\n•	Alberca infantil con 2 carriles de nado, es semi-olimpica\r\n•	Jacuzzi\r\n•	Alberca para niños\r\n•	Asadores\r\n•	Juegos infantiles\r\n•	Pot de golf\r\n \r\nLos departamentos están terminados incluyen cocina, solo les faltan las roperías.', NULL, '8183562248', 15, 1, 3, 1, 1, 'Eva Exclusive Vivant', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 4, 3, NULL, NULL, '2015-02-06 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 1, 34315, NULL, 0.00, 0, 9),
