(389, 54, 2, 1, 19, 'Blvd. Díaz Ordaz', '140', NULL, NULL, NULL, NULL, '25.6438162,-100.39125990000002', '2016-08-29 11:56:27', 1, 0, 0, 2649954.00, NULL, NULL, 1, NULL, 0, 0, 'Santa Maria', 'El proyecto tiene departamentos con espacios muy amplios para atender a las necesidades de cada tipo de cliente, desde 98m2 hasta 296m2. Sus precios varían desde $2,650,000.00 hasta $8,500,000.00 sujetos a cambios según el avance de la obra.Se entregan en Junio 2016.\r\n\r\nSe entregan en obra blanca que incluye pisos de porcelanato, pintura blanca en muros, plafón cerrado, iluminación, puerta principal y puerta de servicio.', NULL, '8183562248', 0, 1, 3, 1, 1, 'Las Fridas', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, '2014-08-05 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 0, 26744, NULL, 0.00, 0, 9),
(390, 50, 2, 1, 19, NULL, NULL, NULL, NULL, NULL, NULL, '25.6744915,-100.3996204', '2016-08-29 12:02:52', 0, 0, 0, 0.00, 345.00, NULL, 1, NULL, 0, 0, 'San Patricio', 'Excelente desarrollo con Diseño Arquitectónico y Paisajístico único, ubicado en la zona mas exclusiva de San Pedro con la mejor vigilancia, acceso controlado y seguridad 24 horas.\r\n\r\n5 Torres de departamentos en pisos totalmente independientes y una gran altura interior.\r\n\r\nDepartamentos confortables de 345m2 de área habitable, Balcones de 90m2, terrazas de 167m2 o de 469m2,  en el caso del PH\r\n\r\nCuenta con amenidades como  Alberca, Salón de usos múltiples, Gimnasio, Green Roof  y Vitapista para jogging. Cada departamento cuenta con 3 cajones de estacionamiento con la opción de comprar un 4to. Y una bodega de 6,55m2\r\n\r\nSe entregan en obra gris en su interior totalmente terminadas sus áreas exteriores.\r\n\r\nFecha de entrega verano 2015.', NULL, '8183562248', 15, 1, 3, 1, 1, 'Las Terrazas', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, '2015-01-05 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 0, 32125, NULL, 0.00, 0, 9),
(391, 54, 2, 1, 19, 'Gomez Morin', NULL, NULL, NULL, NULL, NULL, '25.6528936,-100.4047124', '2016-08-29 13:06:35', 1, 0, 1, 16200000.00, 530.00, NULL, 1, NULL, 0, 1, 'San Angel', 'Exclusiva torre de residencias ubicada en una zona de gran plusvalia con la mejor vista de San pedro. Edificio moderno diseñado por el prestigioso despacho del arquitecto Adán Lozano.\r\n\r\nConsta de una excelente ubicación y fácil acceso, muy cerca de todo.\r\n\r\nOrientación inigualable, que permite contemplar la belleza de la Sierra Madre debido a las vistas espectaculares, logradas por sus ventanales panorámicos y amplias terrazas al oriente y al sur del edificio.\r\n\r\nEspacio íntimo diseñado al gusto, con amplias terrazas perimetrales y vistas panorámicas que permiten una exclusividad y privacidad inigualable.\r\n\r\nCombinación de lujo y comodidad, donde sólo ocho familias disfrutarán todas las comodidades de este proyecto de alto standing, ya que habrá una residencia por nivel, con acceso inmediato mediante dos elevadores de alta velocidad. \r\n\r\nÁrea externa diseñada para un asador empotrado, un agradable espacio de reuniones para compartir y disfrutar nuestra cultura culinaria norteña.\r\n\r\nEl edificio consta de 11 niveles: dos para estacionamientos, el lobby en la planta baja, siete niveles para residencias únicas y el penthouse, además del área de esparcimiento.\r\n\r\nLas alturas interiores de las residencias son de 3.20 m y de 3.60 m para el penthouse.\r\n\r\nCuatro cajones de estacionamiento por residencia y cinco para el penthouse, además de cajones para visitas. Todos techados y bajo estrictas medidas de seguridad y vigilancia. Cada residencia cuenta con una bodega en el estacionamiento.', NULL, '8183562248', 15, 1, 3, 3, 1, 'Residencia NUBO', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 130.00, 'Nuevo', 0, 4, NULL, NULL, '2013-09-03 00:00:00', 1, 1, 58, '2017-08-17 18:39:30', 0, NULL, NULL, 0, 73829, 3, 0.00, 0, 9),
