(560, 54, 2, 1, 33, 'BRICKELL AVENUE', '1080', NULL, NULL, NULL, NULL, NULL, '2016-10-05 14:47:05', 1, 2, 0, 523900.00, NULL, 84.20, 2, NULL, 0, 0, 'Brickell Aveue', '"Con una ubicación central en la famosa Avenida Brickell, The Bond está a poca distancia de los principales bancos y a minutos de los edificios de oficinas Clase A, incluyendo 1450 Brickell Rilea ganador de un premio. A pocos pasos de distancia se encuentra la bulliciosa Mary Brickell Village, el hogar de una variedad de minoristas como Publix, Sports Club LA, un centro de firma deportes y bienestar, elegantes tiendas, restaurantes y bares de clase mundial. Aún más interesante es el próximo acceso de aproximadamente 600.000 pies cuadrados de tiendas de lujo y las tiendas de Brickell CityCentre, que se encuentra actualmente en construcción. Brickell ofrece una excepcional gama de equipamiento de la zona de los mercados de agricultores orgánicos semanal y exposiciones de arte, conciertos de música y eventos deportivos.Categorías a las que pertenece\r\nProyectos verticales ( medio y alto)\r\nAmenidades\r\nAlberca Circuito cerrado Elevador Gimnasio Jardín Jacuzzi Conserje Vigilante Cuarto de lavado Calefacción Sistema de seguridad Terraza Aire acondicionado Accesible a discapacitados Áreas comunes\r\nCaracterísticas Residenciales\r\nPiscina Resort incluyen un jacuzzi con dosel. Súper Cabañas con salones privados y cocinas al aire libre. Biblioteca con sala de proyecciones, Club de Niños y centro de aprendizaje. Centro de negocios ejecutivo, Gimnasio equipado. Instalaciones de spa con baño de vapor y sauna para Hombre y Mujer. Habitación Club con mesa de billar y bar. Salón del propietario privado con refrigerios todos los días.\r\n"', 'Proper Deal', '8183562248', 0, 1, 3, 1, 1, 'THE BOND', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, NULL, NULL, '2015-10-29 00:00:00', 1, 0, NULL, NULL, 0, NULL, NULL, 0, 58621, NULL, 0.00, 0, 17),
