(738, 50, 2, 1, 19, 'Ave Eugenio Garza La Guera', NULL, NULL, NULL, NULL, NULL, NULL, '2016-10-25 18:34:16', 0, 2, 1, 5300000.00, 136.00, NULL, 1, NULL, 0, 1, 'Del Valle Sect Oriente', 'Hermoso departamento de 2 recámaras, 2 1/2 baños, cocina totalmente equipada y vistas espectaculares al cerro de la Silla VAO, proyecto de usos mixtos con oficinas, espacios residenciales, área de comercio y hotel de 5 estrellas, edificado sobre una gran plaza con 14,800 m2 de áreas verdes, espejos de agua, espacios escultóricos y andadores.\r\n\r\nUbicado en Valle Oriente, cuenta con excelentes vialidades, la cercanía de colegios, oficinas, restaurantes, centros comerciales y hospitales,  además del parque Rufino Tamayo, el más grande en San Pedro Garza García, NL.', NULL, '81 8356 2248', 0, 1, 3, 1, 1, 'Liu West', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, 2, NULL, NULL, '2015-08-06 00:00:00', 0, 1, 58, '2016-12-16 14:47:49', 0, NULL, NULL, 1, 47227, NULL, 0.00, 0, 9),
