(755, 58, 2, 1, 19, 'San Alberto', '1003', '1A', NULL, NULL, NULL, NULL, '2016-10-26 08:05:59', 1, 0, 0, 570000.00, 222.26, NULL, 2, NULL, 0, 1, 'Fraccionamiento Los Arcángeles', 'Hermoso departamento totalmente equipado con excelentes acabados de 2 recámaras cada una con su walk-in closet y su baño completo. Cocina muy amplia y barra desayunadora, baño de visitas sala, comedor y estancia. Terraza techada y un jardín de 180 m2.', NULL, '8183562248', 15, 1, 1, 1, 1, 'Arcángeles Torre IV', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Nuevo', 2, 0, NULL, NULL, '2015-04-17 00:00:00', 0, 0, 58, '2016-10-27 19:24:51', 0, NULL, NULL, 1, 39743, NULL, 0.00, 0, 9),
(756, 50, 1, 1, 19, 'Gerónimo Treviño', '102', NULL, NULL, NULL, NULL, NULL, '2016-10-26 11:19:22', 0, 4, 2, 7100000.00, 385.00, 304.00, 1, NULL, 0, 1, 'San Pedro', 'Excelente oportunidad. Casa en muy buenas condiciones,con cochera para 3 autos y cuatro recámaras, cuarto de servicio  en dos plantas y ubicada en privada.\r\n\r\nLa cuarta recámara tiene acceso independiente pero integrada totalmente por el interior por lo que se puede usar como cuarto de juegos, departamento independiente o bien cuarta recámara, cada una con su colset y baño completo.\r\n\r\nPatio pequeño, y muy buena ventilación en su interior.\r\n\r\nNegociable.', NULL, '81 8356 2248', 0, 1, 3, 1, 1, 'Casa Priv. San Fransisco', NULL, NULL, NULL, NULL, 21.00, 18.50, NULL, NULL, NULL, 6, 0, NULL, NULL, '2014-12-10 00:00:00', 0, 1, 58, '2016-12-16 14:47:11', 0, NULL, NULL, 0, 31755, NULL, 0.00, 0, 9),
(757, 50, 2, 1, 19, NULL, NULL, '1809', NULL, NULL, NULL, NULL, '2016-10-26 11:56:04', 0, 1, 1, 1470000.00, NULL, NULL, 1, NULL, 0, 1, 'Distrito Tec', 'Condotec es un innovador concepto ideal para inversionistas, el edificio contara con 140 Suites Condominales de 1 o 2 recamras, que van desde los 47 m2 hasta 110 m2.esta ubicado sobre la Av. Eugenio Garza Sada, casi esquina con la Av. Luis Elizondo, enfrente del TEC de Monterrey, considerada como una de la zonas estudiantiles mas importantes de México.\r\n\r\nse encuentra dentro del plan maestro llamado “DISTRITO TEC”, el cual esta siendo desarrollado por el TEC de Monterrey, para que sea una comunidad dinámica, segura e inspiradora que atrae y retiene talento, e impulsa el desarrollo y posicionamiento de Monterrey como ciudad de innovación, emprendimiento y sustentabilidad.\r\n\r\n• Este plan maestro, contempla la regeneración de todos los alrededores del TEC, generando una zona estudiantil, de estudio, aprendizaje, innovación y convivencia, similar a la que se encuentra en Austin, TX, en la zona de UT (Universidad of Texas)\r\n\r\nContará con los siguientes amenities ubicados en el 12vo piso:\r\n\r\n1. Alberca.\r\n\r\n2. Jacuzzi.\r\n\r\n3. Centro de Estudio.\r\n\r\n4. Salón de eventos tipo Lounge Bar\r\n\r\n5. Cuarto de juegos.\r\n\r\n6. Cine.\r\n\r\n7. Gimnasio.POOL DE RENTAS\r\n\r\n•Los inversionistas que inviertan en RESIDENCIAS CONDOTEC, tendrán la opción de aportar sus unidades al Pool de Rentas del Condohotel.\r\n\r\n•Para los que decidan participar en el Pool de Rentas del Condohotel, será obligatorio adquirir el paquete de equipamiento, de tal manera que todas las unidades tengan el mismo equipamiento y mobiliario.\r\n\r\n•El Pool de Rentas reparte mensualmente los Ingresos Netos que genera el Condohotel en base al indiviso de cada inversionista, de tal manera que el inversionista recibirá ingresos de las rentas independientemente si su unidad esta rentada o no.\r\n\r\nEstará listo para el verano del 2017\r\n\r\nLos precios están sujetos a cambios.', NULL, '81 8356 2248', 0, 1, 3, 1, 1, 'Copia 1 de 69173 Condotec', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Nuevo', 1, 1, NULL, NULL, '2016-04-16 00:00:00', 0, 0, 50, '2016-10-27 23:48:27', 0, NULL, NULL, NULL, 69187, NULL, 0.00, 0, 5),
