 el verano del 2017\r\n\r\nLos precios están sujetos a cambios.', 'Proper Deal', '81 8356 2248', 0, 1, 3, 1, 1, 'Copia 1 de 69173 Condotec', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, NULL, '2016-04-16 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 0, 69185, NULL, 0.00, 0, 5),
