(804, 50, 1, 1, 19, NULL, NULL, NULL, NULL, NULL, NULL, '25.6867816,-100.42196280000002', '2016-10-31 15:24:49', 0, 4, 2, 13400000.00, 456.00, 402.00, 1, NULL, 0, 0, 'Las Fincas', 'Las características de estas residencias en Valle Poniente, son su amplitud, con cielos altos, de grandes ventanas, la distribución es muy funcional y atractiva para el propietario, el tamaño de las recámaras es muy adecuado, siendo éstas de las más grandes en referencia al mercado en general, el diseño arquitectónico es altamente atractivo a primera vista y con alta calidad en las especificaciones constructivas, la selección de colores y materiales de los acabados reflejan un estilo innovador y originalidad. Residencias en 2 1/2 Niveles, con alturas de 3 m a 4.50 m,con mucha iluminación natural, 168 m2 de jardines y terrazas para apreciar las montañas de la Sierra Madre. \r\nLa Distribución de DENDRO Residencias en Valle Poniente dentro de los Fraccionamientos Privados Las Fincas II y Cordillera Residencial 2 y 3 son las siguientes;\r\n\r\nPlanta Baja:\r\n\r\n1. Cochera Triple: 9.00m x 5.50m\r\n2. Foyer/ Recibidor : 4.85m x 3.70m a Doble Altura\r\n3. Antecomedor: 3.00m x 3.00m\r\n4. Cocina Integral Abierta; 4.00m x 3.00m\r\n5. Comedor: 4.00m x 4.00m\r\n6. Sala 1: 4.50m x 3.00m\r\n7. Sala 2: 5.50m x 4.00m\r\n8. Biblioteca: 3.00m x 3.00m\r\n9. Recámara 4 ó de Huéspedes / Home Office: 5.30 x 3.63m (Recámara en planta baja y con entrada independiente)\r\n10. Vestidor walking closet de Recámara 4 ó de Huéspedes / Home Office : 2.91m x 2.20m\r\n11. Baño de Recámara 4 ó de Huéspedes / Home Office: 2.91m x 1.15m\r\n12. Baño Social: 1.03m x 2.80m\r\n13. Lavandería/Cuarto de Servicio: 12.95 m2\r\n14. Baño de Cuarto de Servicio: 1.35m x 1.90 m\r\n15. Jardínes frontales laterales + Jardín Lateral + Jardín Posterior: 168 m2 /172 m2 / 204 m2\r\n\r\nPlanta Alta:\r\n\r\n16. Estancia de T.V.: 3.50m x 5.00 + 1.10m x 1.80 m\r\n17. Sink: 0.60m x 1.15m\r\n18. Blancos: 0.85m x 1.30m\r\n19. Recámara 1: 3.50m x 4.65m\r\n20. Vestidor walking closet de Recámara1: 2.35m x 3.45m\r\n21. Baño de Recámara1: 1.15m x 3.45m\r\n22. Terraza/Deck de Recámara 1: 19.57m2\r\n23. Recámara 2: 3.45m x 4.90m\r\n24. Vestidor walking closet de Recámara 2: 2.50m x 3.60m\r\n25. Baño de Recámara 2: 1.15m x 3.60m\r\n26. Terraza/Deck de Recámara 1: 1.65m x 3.75m\r\n27. Recámara Principal: 3.85m x 5.15m\r\n28. Vestidor walking closet de Recámara Principal: 2.95m x 3.60m\r\n29. Baño de Recámara Principal: 3.50m x 4.15m (Baño con doble lavaneta + regadera + bidet + tina)\r\n30. Terraza/Deck de Recámara Principal: 1.80m x 6.55\r\n31. Terraza/Deck Intima de Baño Principal: 1.50m x 3.25m\r\n\r\nEspecificaciones de las residencias (proyecto llave en mano)\r\n\r\n1. Cimentación. Cimentación corrida a base de concreto ciclópeo, profundidad variable,combinada con zapatas aisladas armadas y colocadas con concreto premezclado según cálculo estructura.\r\n2. Estructura. Muros exteriores e interiores de block #4 y block #6 asentados con mortero cemento-arena\r\ncastillos y cerramientos de concreto armado según cálculo. Firmes y banquetas de concreto premezclado desbastado y pulido. Losas de vigueta y bovedillas concreto premezclado según cálculo escalera de concreto reforzado acabado desbastado y pulido.\r\n3. Instalaciones hidrosanitarias y gas. Instalaciones hidráulicas con tubería y conexiones de cobre tipo M, instalaciones de gas con tubería y conexiones de cobre tipo L, instalaciones sanitarias con tubería de PVC de alta densidad \r\n4. Instalaciones eléctricas. instalación de tubería con poliducto reforzado de 1/2"" para contactos e iluminación, de 3/4"" para telefonía y televisión y de 1"" para aire acondicionado, cableado eléctrico calibre #12 para contactos e iluminación y #14 para apagadores, centro de carga e interruptor general marca square-d según cálculo eléctrico, iluminación por luminarias incandescentes empotradas marca Magg y luminarias de sobreponer fluorescente marca Magg, apagadores y contactos marca Niessen-Estevez modelo alpha,contactos para exteriores marca Supplier\r\n5. Yesos. Aplanados de yeso con mortero-agua de 2 cm de espesor maestreado.\r\n6. Pintura viníl-acrílica marca Berel calidad Multitono en muros exteriores y adicionado con arena silica en interiores con una mano de sellador y dos manos de pintura.\r\n7. Puertas de madera. Puertas interiores importadas alemanas marca: Haicor enchapadas en madera de haya con chambranas.\r\n8. Puertas exteriores. Puertas metálicas de seguridad importadas en puerta principal y puerta de lavandería\r\n9. Ventanería de aluminio. Línea panorama de la marca Cuprum de 3"" en color blanco y negro acuarela con cristal tintex azul de 6 mm.\r\n10. Cancelería de cristal templado. en las puertas y fijos de 9.5 mm de todos los baños.\r\n11. Porcelánicos importados. en pisos, muros y cielos de todos los baños, en pisos y muros de lavandería y cuarto de servicio\r\n12. Duela laminada. Duela importada de 9mm alemana marca Haro de nogal y roble café decapado en recibidor, cocina, sala, comedor, estancia de t.v., distribuidor, en todas las recámaras y vestidores\r\n13. Mezcladoras. Mezcladoras mono mando para lavabos y para regaderas marca Helvex modelo Axiss E-90 y Axiss E-73, regadera tipo teléfono para todo los baños, cespol para lavabos modelo: TV-017, mezcladoras monomando para fregadero y tarja de bar marca Helvex modelo 24HL.\r\n14. Accesorios para baños. accesorios de acero inoxidable marca Helvex modelos:12104-AL, 12105-AL, 12109-AL, 12106-AL, 12107-AL, 12148-AL\r\n15. Mobiliario de baños. Mobiliarios importados contemporáneos en todos los baños.\r\n16. Ovalines sanitarios. Ovalines cerámicos importados de sobreponer para todos los baños.\r\n17. Cocina integral. Cocina integral contemporánea en MDF y melamina con cubierta Kober color blanco y gabinetería de color rojo brillante o negro brillante\r\n18. Vestidores. Vestidores en MDF y melamina en color blanco en todas las recámaras\r\n19. Fachadas. porcelánicos importados en recubrimientos de fachada y aplanados según diseño y especificaciones.\r\n20. Instalaciones especiales. preparación hidrosanitaria y eléctrica para equipo de aire acondicionado tipo mini-split en área de sala, estancia de t.v. y en todas las recámaras.\r\n21. Impermeabilización con sistema prefabricado (membranas) de 4 mm\r\n22. Tierra y césped San Agustín en los 4 jardines.\r\n\r\nCRÉDITO HIPOTECARIO PREVENTA SCOTIABANK', 'Proper Deal', '8183562248', 0, 1, 1, 1, 3, 'Las Fincas', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Nueva', 6, 3, NULL, NULL, '2015-12-11 00:00:00', 1, 1, NULL, NULL, 0, NULL, NULL, 1, 61519, NULL, 0.00, 0, 6),
(805, 50, 1, 1, 19, 'Tuxtepec', '211', NULL, NULL, NULL, NULL, '25.6408775,-100.38087150000001', '2016-10-31 15:41:30', 0, 3, 3, 8010000.00, NULL, NULL, 1, NULL, 0, 0, 'Lomas del Valle', 'Residencias en Zona Valle, con casas amplias y contemporáneas de Diseño Europeo a precio de Mercado en Privadas de 3 a 7 casas únicamente con régimen de Condominio Horizontal en la colonia Lomas Del Valle.\r\n(Opción de 3 Niveles, en nivel sótano con recámara 4 o huéspedes + baño + vestidor + oficina/estudio/home-theater + bodega) Planta Baja\r\nOpción de 3 recámaras $8, 010,000.00\r\nOpción de 4 recámaras $9, 300,000.00\r\nEntregadas llave en mano y las especificaciones incluyen lo siguiente:\r\n1. Impermeabilización por sistema de membranas asfálticas\r\n2. Puertas de madera alemanas Haicor\r\n3. Ventanería de Aluminio Cuprum Eurovent S45\r\n4. Cancelería de Cristal templado en baños\r\n5. Duela sólida de 14mm de Bamboo en toda la casa, excepto en áreas húmedas\r\n6. Porcelánicos en áreas húmedas y de servicio.\r\n7. Pintura Berel Multitono a escoger\r\n8. Mobiliario Sanitario y Mezcladoras\r\n9. Luminarios Magg\r\n10. Accesorios y material eléctrico Estévez\r\n11. Accesorios Sanitarios\r\n12. Vestidores y Closets diseñados por diedro.diseño contemporáneo\r\n13. Cocina Integral\r\n\r\nTambién incluye:\r\n 1. Minisplit de 2 ton en las 3 recámaras y de 3 ton en la sala/comedor y en la estancia de TV marca Trane o LG o Toshiba\r\n 2. Equipos electrodomésticos para la cocina y lavandería marca GE monogram y GE profile\r\n 3. Amoblamiento de toda la casa en 3 ambientes diferentes con muebles importados alemanes e italianos a precio de Mueblería local\r\n4. Decoración, Interiorismo y luminarias de acento y detalle importadas alemanas e italianas a precio local\r\n5. Equipo de Aspirado integral en todas las habitaciones\r\n6. Diseño de Paisajismo y Construcción con especies nativas de la región, con riego automatizado por aspersión por petición\r\n7. Vapor en cabinas de regadera\r\n8. Tina de hidromasaje y bidet en baño principal\r\n9. Automatización y Domótica con tecnología francesa\r\n10. Sistema de Alarma y Vigilancia\r\n11. Diseño y Construcción de Alberca o Estanque Natural/Espejo de Agua con mantenimiento sustentable ecológico-natural. \r\n12. Jacuzzi para exteriores para 5 ó 7 personas en deck.', 'Proper Deal', '8183562248', 0, 1, 3, 1, 3, 'Residencias Lomas del Valle', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Proyecto', 4, 2, NULL, NULL, '2015-12-12 00:00:00', 1, 1, NULL, NULL, 0, NULL, NULL, 1, 61523, NULL, 0.00, 0, 9),
(806, 50, 2, 1, 19, '16 de septiembre', '310', '302', NULL, NULL, NULL, '25.6597598,-100.43760880000002', '2016-10-31 15:48:30', 0, 3, 0, 3857517.00, 210.41, NULL, 1, NULL, 0, 0, 'Loma Blanca', 'Hermoso edificio de departamentos en Valle Poniente desde 78 m2 hasta 210 m2 de 1,2 y 3 recámaras.\r\nSerá el primer desarrollo inmobiliario que incorpora el concepto de Condohotel Urbano en su modelo de negocio, donde los propietarios podrán meter su unidad a un Pool de Rentas.\r\n\r\nCuenta con amenities como Alberca, Jacuzzi, Business Center, Lounge Bar, Cuarto de Juegos, Cuarto de Cine y Gimnasio.\r\nSe entregan terminados y acabados. (No incluye Climas, Closets ni Cocina) \r\n\r\nSus precios están sujetos a cambios.', 'Proper Deal', '8183562248', 14, 1, 3, 1, 1, 'Residencias Valle Poniente', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Nuevo', 3, 2, NULL, NULL, '2014-08-28 00:00:00', 0, 1, NULL, NULL, 0, NULL, NULL, 1, 27890, NULL, 0.00, 0, 6),
